definition:
Pertaining to or characterized by, boasting and pretension;
   used by quacks; pretending to cure diseases; as, a quack medicine; a
   quack doctor.

That may be sqyared, or reduced to an equivalent square;
   -- said of a surface when the area limited by a curve can be exactly
   found, and expressed in a finite number of algebraic terms.

Curious and fanciful; affected; odd; whimsical; antique;
   archaic; singular; unusual; as, quaint architecture; a quaint
   expression.

The act of limiting, or the state of being limited;
   that which qualifies by limiting; modification; restriction; hence,
   abatement; diminution; as, to use words without any qualification.

The attribute of being so much, and not more or less; the
   property of being measurable, or capable of increase and decrease,
   multiplication and division; greatness; and more concretely, that which
   answers the question "How much?"; measure in regard to bulk or amount;
   determinate or comparative dimensions; measure; amount; bulk; extent;
   size.

That which can be increased, diminished, or measured;
   especially (Math.), anything to which mathematical processes are
   applicable.

Apt or disposed to quarrel; given to brawls and
   contention; easily irritated or provoked to contest; irascible;
   choleric.

One limb of a quadruped with the adjacent parts; one
   fourth part of the carcass of a slaughtered animal, including a leg;
   as, the fore quarters; the hind quarters.

To furnish with shelter or entertainment; to supply
   with the means of living for a time; especially, to furnish shelter to;
   as, to quarter soldiers.

Examination with reference to a decisive result;
   investigation; specifically, a judicial or official investigation;
   also, examination under torture.

That which is quick, or alive; a living animal or plant;
   especially, the hawthorn, or other plants used in making a living
   hedge.

To calm; to appease; to pacify; to lull; to allay; to
   tranquillize; as, to quiet the passions; to quiet clamors or disorders;
   to quiet pain or grief.

The quality or state of being quiet; freedom from noise,
   agitation, disturbance, or excitement; stillness; tranquillity;
   calmness.

The number resulting from the division of one number by
   another, and showing how often a less number is contained in a greater;
   thus, the quotient of twelve divided by four is three.
